        if (isset($this->dueDate)) {
            $json['dueDate']               = $this->dueDate;
        }
        if (isset($this->expirationDate)) {
            $json['expirationDate']        = $this->expirationDate;
        }
        if (isset($this->sendOn)) {
            $json['sendOn']                = $this->sendOn;
        }
        if (isset($this->inactive)) {
            $json['inactive']              = InactiveEnum::checkValue($this->inactive);
        }
        if (isset($this->frozen)) {
            $json['frozen']                = FrozenEnum::checkValue($this->frozen);
        }
        if (isset($this->invoiceLineItems)) {
            $json['invoiceLineItems']      = $this->invoiceLineItems;
        }
        if (isset($this->invoiceResults)) {
            $json['invoiceResults']        = $this->invoiceResults;
        }

        return (!$asArrayWhenEmpty && empty($json)) ? new stdClass() : $json;
    }
}
